import React, { useEffect } from 'react'

function App() {

  const [msg, setMsg] = useState();

  useEffect(async () => {
      const response = await axios.get('http://localhost:8000/');
      setMsg(response.data);
  })

  return (
    <div>
      <h1>{}</h1>
    </div>
  )
}

export default App
